import React from "react";

const beautifulScreen = (props) => {
	return (
		<div className="BeautifulScreen">
			<form>
				<input type="text" value={props.result} onChange={props.change} />
				<input type="text" value={props.calc} onChange={props.calc} />
			</form>
		</div>
	);
};

export default beautifulScreen;
